          </button>

          {status === 'success' && (
            <p className="mt-4 text-sm font-medium text-emerald-400">
              Te≈üekk√ºrler! Kƒ±sa s√ºre i√ßinde d√∂n√º≈ü yapacaƒüƒ±m.
            </p>
          )}
          {status === 'error' && (
            <p className="mt-4 text-sm font-medium text-rose-400">
              Bir sorun olu≈ütu: {errorMessage}
            </p>
          )}
        </form>
      </div>
    </Section>
  );
}
